import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { makeStyles } from '@material-ui/core/styles';
import { purple, deepPurple } from '@material-ui/core/colors';


const useStyles = makeStyles({
  list: {
    width: 250,
  },
  title: {
    flexGrow: 1,
    color: purple[800]
  },
  menuButton: {
    marginLeft: -15,
  },
});


export default function Header() {
  
  const classes = useStyles();

  return (
    <React.Fragment>
    <CssBaseline />
      <AppBar position="relative" color="inherit" classes={{cplorPrimary: deepPurple[900]}}>
        <Toolbar>
          <IconButton className={classes.menuButton} color="inherit" aria-label="Menu">
              <MenuIcon style={{ color: purple[800]}}/>
          </IconButton>
          <Typography variant="h6" className={classes.title} align="center" color="inherit">Shin-Nosuke Iino</Typography>
          <div><a href="https://github.com/Shinnosuke7031"><i class="fa fa-github fa-2x" aria-hidden="true"></i></a></div>
        </Toolbar>
      </AppBar>
  </React.Fragment>
  );
}
